description:
Crime Inspector Maria Wern returns to duty at the Police Department on the island of Gotland, and is immediately thrown into a murder investigation Simultaneously two people are feared dead from the bird flu and all resources are set in to contain the virus The investigation shows that the murdered man has brought contaminated birds to Gotland and the disease is spreading. Gotland is in a state of upproar. The medicine is ineffective and people are desperate. It is revealed that those responsible for spreading the virus have a vaccine. But where? A dramatic chase leads Maria to the answer.


